import {
  Button,
  Typography,
  Paper,
  TextField,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Grid,
} from "@material-ui/core";
import { useState } from "react";

const category = [
  "Sexual Harrassment",
  "Gender Discrimination",
  "Domestic Violence",
  "Ragging/Bullying",
  "Eve t=Teasing",
  "Social Media Harrassment",
  "Dowry",
  "Snatching/Theft",
];

const AppointmentForm = () => {
  const [step, setStep] = useState(0);

  switch (step) {
    case 0:
      return <AssistanceType setStep={setStep} />;
    case 1:
      return <FirstStep setStep={setStep} />;
    case 2:
      return <SecondStep setStep={setStep} />;
    case 3:
      return <CompletedStep />;
  }
};

const AssistanceType = ({ setStep }) => {
  return (
    <Paper
      align="center"
      style={{ height: "40vh", marginTop: 20, padding: 20 }}
    >
      <Typography variant="h5">What do you seek?</Typography>
      <Button variant="contained" onClick={() => setStep(1)}>
        Counseling
      </Button>
      <br />
      <Button variant="contained" color="primary" onClick={() => setStep(1)}>
        Legal Guidance
      </Button>
      <br />
      <Button variant="contained" color="secondary" onClick={() => setStep(1)}>
        Legal Action
      </Button>
    </Paper>
  );
};

const FirstStep = ({ setStep }) => {
  const [category, setCategory] = React.useState("");

  const handleCategoryChange = (event) => {
    setCategory(event.target.value);
  };

  return (
    <Paper align="left" style={{ height: "40vh", marginTop: 20, padding: 20 }}>
      <h1>step 1</h1>

      <Grid container alignItems="center" style={{ marginBottom: 10 }}>
        <Grid item>
          <Typography variant="body1">
            Please select a category of your problem:
          </Typography>
        </Grid>

        <Grid item>
          <FormControl style={{ minWidth: 200, marginLeft: 10 }}>
            <Select value={category} onChange={handleCategoryChange}>
              <MenuItem value="">
                <em>None</em>
              </MenuItem>

              {category.map((ctg) => (
                <MenuItem value={10}>ctg</MenuItem>
              ))}

              <MenuItem value={10}>Ten</MenuItem>
              <MenuItem value={20}>Twenty</MenuItem>
              <MenuItem value={30}>Thirty</MenuItem>
            </Select>
          </FormControl>
        </Grid>
      </Grid>

      <Typography variant="body1">Please describe your problem:</Typography>

      <TextField
        name="description"
        placeholder="Write a few lines about your problem..."
        fullWidth
        multiline
        variant="outlined"
      />

      <Button onClick={() => setStep(0)}>Back</Button>
      <Button onClick={() => setStep(2)}>Next</Button>
    </Paper>
  );
};

const SecondStep = ({ setStep }) => {
  return (
    <Paper
      align="center"
      style={{ height: "40vh", marginTop: 20, padding: 20 }}
    >
      <h1>step 2</h1>
      <Button onClick={() => setStep(1)}>Back</Button>
      <Button onClick={() => setStep(3)}>Submit</Button>
    </Paper>
  );
};

const CompletedStep = () => {
  return (
    <Paper
      align="center"
      style={{ height: "40vh", marginTop: 20, padding: 20 }}
    >
      <h1>Completed!</h1>
    </Paper>
  );
};

export default AppointmentForm;
